    public partial class LeveledItemXmlCreateTranslation : ItemAbstractXmlCreateTranslation
    {
        public new readonly static LeveledItemXmlCreateTranslation Instance = new LeveledItemXmlCreateTranslation();

        public static void FillPublicXml(
            ILeveledItemInternal item,
            XElement node,
            ErrorMaskBuilder errorMask,
            TranslationCrystal translationMask)
        {
            try
            {
                foreach (var elem in node.Elements())
                {
                    LeveledItemXmlCreateTranslation.FillPublicElementXml(
                        item: item,
                        node: elem,
                        name: elem.Name.LocalName,
                        errorMask: errorMask,
                        translationMask: translationMask);
                }
            }
            catch (Exception ex)
            when (errorMask != null)
            {
                errorMask.ReportException(ex);
            }
        }

        public static void FillPublicElementXml(
            ILeveledItemInternal item,
            XElement node,
            string name,
            ErrorMaskBuilder errorMask,
            TranslationCrystal translationMask)
        {
            switch (name)
            {
                case "ChanceNone":
                    try
                    {
                        errorMask?.PushIndex((int)LeveledItem_FieldIndex.ChanceNone);
                        item.ChanceNone = ByteXmlTranslation.Instance.Parse(
                            node: node,
                            errorMask: errorMask);
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                case "Flags":
                    try
                    {
                        errorMask?.PushIndex((int)LeveledItem_FieldIndex.Flags);
                        item.Flags = EnumXmlTranslation<LeveledFlag>.Instance.Parse(
                            node: node,
                            errorMask: errorMask);
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                case "Entries":
                    try
                    {
                        errorMask?.PushIndex((int)LeveledItem_FieldIndex.Entries);
                        if (ListXmlTranslation<LeveledEntry<ItemAbstract>>.Instance.Parse(
                            node: node,
                            enumer: out var EntriesItem,
                            transl: LoquiXmlTranslation<LeveledEntry<ItemAbstract>>.Instance.Parse,
                            errorMask: errorMask,
                            translationMask: translationMask))
                        {
                            item.Entries.SetTo(EntriesItem);
                        }
                        else
                        {
                            item.Entries.Unset();
                        }
                    }
                    catch (Exception ex)
                    when (errorMask != null)
                    {
                        errorMask.ReportException(ex);
                    }
                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                default:
                    ItemAbstractXmlCreateTranslation.FillPublicElementXml(
                        item: item,
                        node: node,
                        name: name,
                        errorMask: errorMask,
                        translationMask: translationMask);
                    break;
            }
        }

    }

